SET @@AUTOCOMMIT = 1;

DROP DATABASE IF EXISTS SENIOR;
CREATE DATABASE SENIOR;

USE SENIOR;

CREATE TABLE Users(
    user_id INTEGER PRIMARY KEY AUTOINCREMENT,
    username varchar(100) NOT NULL ,
    "password" varchar(100) NOT NULL ,
    surname varchar (25) NOT NULL,
    preferred varchar (25) NOT NULL,
    title varchar (5) NOT NULL,
    email varchar(100) NOT NULL ,
    address varchar (50),
    suburb varchar(50),
    "state" varchar (25),
    postcode int(10),
    country varchar (25),
    created timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE ItemStock(
    product_id INTEGER PRIMARY KEY AUTOINCREMENT,
    product_name varchar(50),
    description varchar(200),
    price FLOAT(2),
    in_stock int NOT NULL
);

CREATE TABLE ItemImages(
    product_id int NOT NULL,
    image_hash blob,
    PRIMARY KEY(product_id, image_hash)
);

CREATE TABLE luShippingMethods(
    shipping_id INTEGER PRIMARY KEY AUTOINCREMENT,
    "type" varchar(25) NOT NULL,
    price float(2) NOT NULL
);

CREATE TABLE Purchases(
    invoice_id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id int NOT NULL,
    shipping_id int NOT NULL,
    address varchar (50) NOT NULL,
    suburb varchar(50) NOT NULL,
    "state" varchar (25) NOT NULL,
    postcode int(10) NOT NULL,
    country varchar (25) NOT NULL,
    price FLOAT(2) NOT NULL,
    created timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE PurchaseItems(
    invoice_id int NOT NULL,
    item_id int NOT NULL,
    quantity int NOT NULL,
    PRIMARY KEY (invoice_id,item_id)
);

CREATE user IF NOT EXISTS dbadmin@localhost;
GRANT all privileges ON SENIOR.User TO dbadmin@localhost;

